import './App.css';
import FetchPosts from './fetchPosts'
import CreatePost from './createPost'
import { useState } from 'react';


function App() {
  return (
    <div className="App">
      <Feed/>
    </div>
  );
}

function Feed() {
  const [ isPosting, toggleMode] = useState(false)

  if (isPosting === false)
    return (
    <FetchPosts/>
    )
  else return (
    <CreatePost/>
  )
}







export default App;
